import { useEffect, useDispatch, useSelector } from "react";



export default setup = () => {
    const dispatch = useDispatch();
    const token = useSelector(state => state.auth.token);
    console.log("token", token);

    useEffect(() => {
        dispatch(getMoviesreducer(token));
    }, [dispatch, token]);
}
